u national. De plus, il n'y a pas de valeurs nulles. Nous supprimerons la colonne \"region\".\n#La colonne \"level\" peut être supprimée après le filtrage des données au niveau national. \n#Nous avons besoin d'autres colonnes dans notre analyse. Nous nous occuperons des types de données après tout nettoyage.\n\n\n\n#long_DF$Expectancy = as.numeric(long_DF$Expectancy) TODO BUT MAYBE AFTER\nglimpse(long_DF)\n\n\ndata_all_national=long_DF %>% filter(long_DF$Level=='National')\ndata_all_national = select(data_all_national,-4)\n\nsummary(data_all_national)\nglimpse(data_all_national)\n#Dealing with Not Available\n\ncat(paste(\"\\nCombien de valeurs Not Available contient data set \"),sum(data_all_national=='Not Available'))","metadata":{"execution":{"iopub.status.busy":"2022-03-21T21:41:44.736612Z","iopub.execute_input":"2022-03-21T21:41:44.738363Z","iopub.status.idle":"2022-03-21T21:41:45.058763Z"},"trusted":true},"execution_count":31,"outputs":[{"name":"stderr","text":"\u001b[1m\u001b[1mRows: \u001b[1m\u001b[22m\u001b[34m\u001b[34m1969\u001b[34m\u001b[39m \u001b[1m\u001b[1mColumns: \u001b[1m\u001b[22m\u001b[34m\u001b[34m34\u001b[34m\u001b[39m\n\n\u001b[36m──\u001b[39m \u001b[1m\u001b[1mColumn specification\u001b[1m\u001b[22m \u001b[36m────────────────────────────────────────────────────────\u001b[39m\n\u001b[1mDelimiter:\u001b[22m \",\"\n\u001b[31mchr\u001b[39m (34): Country, Country_Code, Level, Region, 1990, 1991, 1992, 1993, 1994...\n\n\n\u001b[36mℹ\u001b[39m Use \u001b[30m\u001b[47m\u001b[30m\u001b[47m`spec()`\u001b[47m\u001b[30m\u001b[49m\u001b[39m to retrieve the full column specification for this data.\n\u001b[36mℹ\u001b[39m Specify the column types or set \u001b[30m\u001b[47m\u001b[30m\u001b[47m`show_col_types = FALSE`\u001b[47m\u001b[30m\u001b[49m\u001b[39m to quiet this message.\n\n","output_type":"stream"},{"output_type":"display_data","data":{"text/html":"<table class=\"dataframe\">\n<caption>A tibble: 59070 × 6</caption>\n<thead>\n\t<tr><th scope=col>Count